import React from 'react';
import { createBrowserRouter, RouterProvider, Route } from 'react-router-dom';

import HomePage from './HomePage';
import  ProjectPage from './ProjectPage';


const home = createBrowserRouter([<Route  path='/' component=  {HomePage} />]);



const projetos = [<Route  path='/projetos' component= {ProjectPage} />];



function App() {
  return (
    <React.StrictMode>
    <RouterProvider router={home} routes={projetos} ></RouterProvider>
    </React.StrictMode>
  );
}

export default App;
